
    /*
     * isban.util.UtilsPDF.js
     *
     * Modulo responsable de dotar de funciones de utilidad especificas para el modulo de exportación PDF
     *
     * @require lib.jsPDF.0.9.0rc2.jspdf.js
     *
     */
    function UtilsPDF () 
    {

        // Variable con la referencia actual de la altura en el documento PDF
        this.height = 20;

        // Variable con la referencia del margen izquierdo del documento PDF
        this.marginLeft = 
        {
            h1 : 10,
            h2 : 15,
            h3 : 20,
            h4 : 25
        };

        // Variable con el interlineado en el salto de linea
        this.marginNewLine =    
        {
            title : 15,
            subtitle : 10,
            normal : 5,
            normal_negrita : 5,
            sub_normal : 5
        };
       
        // el numero de pagina siempre empieza en 2 contando portada e indice
        this.numberPage = 2;

        // el numero total de paginas
        this.totalNumerPage = 0;

        // la estructura del indice
        var index = [];

        // Variable con el limite de altura de cada pagina del documento PDF
        var _limitY = 260;

        // Variable con la imagen del grupo santander en base 64
        var _logoGrupoSantander = "data:image/jpeg;base64,";

        // Variable con la imagen de isban en base 64
        var _logoIsban = "data:image/jpeg;base64,";

        // Objeto json con los estilos del documento PDF
        var _styles =  
        {
            title_doc :     {
                                font : "helvetica",
                                type : "bold",
                                size : 24,
                                color :     {
                                                red : 236,
                                                green : 0,
                                                blue : 0
                                            }
                            },
            title :     {
                            font : "helvetica",
                            type : "bold",
                            size : 16,
                            color : {
                                        red : 236,
                                        green : 0,
                                        blue : 0
                                    }
                        },
            subtitle :  {
                            font : "helvetica",
                            type : "bold",
                            size : 13,
                            color :     {
                                            red : 0,
                                            green : 0,
                                            blue : 0
                                        }
                        },
            subsubtitle :   {
                            font : "helvetica",
                            type : "italic",
                            size : 13,
                            color :     {
                                            red : 84,
                                            green : 84,
                                            blue : 84
                                        }
                            },
            normal :    {
                            font : "helvetica",
                            type : "normal",
                            size : 10,
                            color :     {
                                            red : 0,
                                            green : 0,
                                            blue : 0
                                        }
                        },
            normal_negrita : {
                            font : "helvetica",
                            type : "bold",
                            size : 10,
                            color :     {
                                            red : 0,
                                            green : 0,
                                            blue : 0
                                        }
                        }
        };

        // Variable con la correción aproximada en los saltos de linea para fuente en negrita
        var _correctionFactorN = 0.6;

        // Variable con la correción aproximada en los saltos de linea para fuente en normal
        var _correctionFactorP = 0.4;
      
        /*
         * metodo que devuelve la altura actual del documento
         */
        this.getHeight = function ()
        {
            return this.height;
        };

        /*
         * Metodo que devuelve el logo del grupo santander en base 64
         */
        this.getLogoGrupoSantander = function ()
        {
            return _logoGrupoSantander;
        };

        /*
         * Metodo que en funcion de tipo de fuente configura el estilo en el documento PDF
         *
         * @param doc (jsPDF) documento PDF
         * @param sStyle (string) nombre del estilo
         */
        this.getStyle = function (doc, sStyle)
        {
            return _getStyle(doc,sStyle);
        };

        /*
         * Metodo que añade un salto de linea en el documento PDF
         *
         * @param doc (jsPDF) documento PDF
         * @param font (Number) distacia de salto de linea
         */
        this.newLine = function (doc, font)
        {
            if( (this.height +(font))  <  _limitY )
            {
                return this.height += font;
            }
            else
            {
                return this.addPage(doc);
            }
        };

        /*
         * Metodo que añade una pagina al documento PDF
         *
         * @param doc (jsPDF) documento PDF
         */
        this.addPage = function (doc)
        {
            this.writeFootNote(doc);
            this.numberPage++;
            doc.addPage();
            this.height = 20;
            return doc;
        };

        /*
         * Metodo que añade una linea al indice del documento PDF
         *
         * @param title (string) nombre del apartado del indice
         * @param number (Number) numero de pagina
         */
        this.addRowIndex = function (title, number)
        {
            var rowIndex = {};
            rowIndex.title = title;
            rowIndex.number = number;
            index.push(rowIndex);
        };

        /*
         * Metodo que añade una linea al indice del documento PDF
         */
        this.getIndex = function ()
        {
            return index;
        };

        /*
         * Metodo que fija el total de paginas a la actual pagina del documento PDF;
         */
        this.setTotalPages = function ()
        {
            this.totalNumerPage = this.numberPage;

        };

        /*
         * Metodo que indica la pagina actual del documento PDF;
         *
         * @param actualNumerPage (Number) pagina actual del documento PDf
         */
        this.setActualPage = function (actualNumerPage)
        {
            this.numberPage = actualNumerPage;
        };

        /*
         * Funcion que pinta el pie de pagina en el documento PDF
         *
         * @param doc (jsPDF) documento PDF
         */
        this.writeFootNote = function (doc)
        {
            doc.line(0, 280, 220, 280);
            doc.addImage( _logoIsban,'JPEG',0,283,50,15);
            doc = _getStyle(doc,"normal");
            doc.text(50,290,"© Ingeniería de Software Bancario, S.L. – Todos los derechos reservados.");
            doc.text(175,290,"Página "+this.numberPage+ " de "+this.totalNumerPage);
        };

        /*
         * Metodo que da un estilo al documento en funcion del tipo de fuente
         *
         * @param doc (jsPDF) documento PDF
         * @param sStyle (string) nombre del estilo
         */
        var _getStyle = function (doc, sStyle)
        {
            style = _styles[sStyle];
            doc.setFont(style.font);
            doc.setFontType(style.type);
            doc.setFontSize(style.size);
            doc.setTextColor(style.color.red, style.color.green, style.color.blue);
            return doc;
        };
    }

    /*
     * Fachada del modulo UtilsPDF
     */
    UtilsPDF.prototype = 
    {

        getHeight : this.getHeight,

        getMarginLeft : this.getMarginLeft,

        newLine : this.newLine,

        newLines : this.newLines,

        getStyle : this.getStyle,

        addPage : this.addPage,

        writeFootNote : this.writeFootNote,

        marginNewLine :this.marginNewLine,

        marginLeft : this.marginLeft,

        addRowIndex : this.addRowIndex,

        getIndex : this.getIndex,

        setTotalPages : this.setTotalPages,

        setActualPage : this.setActualPage

    };